sep.vars = function(x){
  x = gsub(" ", "", x, fixed = TRUE)
  x = unlist(strsplit(x,"+",fixed=T))
  return(x)
}

censor =  function(x, fraction=.005){
  if(length(fraction) != 1 || fraction < 0 || fraction > 1){
    stop("bad value for 'fraction'")
  }
  lim <- quantile(x, probs=c(fraction/2, 1-fraction/2), na.rm = T)
  x[ x < lim[1] ] <- NA
  x[ x > lim[2] ] <- NA
  x
}

